import React from 'react';
import styles from '../styles/Projects.module.css';

const Projects = () => {
    const projects = [
        {
            id: 1,
            title: "Alzheimer Detection with CNN",
            image: "/public/predicciones.png",
            description: "Deep learning model using convolutional neural networks to detect Alzheimer's patterns in MRI brain scans. Achieved 85% accuracy in early stage detection using advanced preprocessing techniques.",
            technologies: ["Python", "TensorFlow", "Keras", "OpenCV", "NumPy"],
            github: "https://github.com/usuario/alzheimer-detection"
        },
        {
            id: 2,
            title: "Hospital Data Warehouse", 
            image: "/project2.jpg",
            description: "Comprehensive ETL pipeline and data warehouse solution for US hospital data analysis. Interactive dashboards for healthcare insights with real-time data processing capabilities.",
            technologies: ["SQL Server", "Power BI", "Apache NiFi", "Python", "MDX"],
            github: "https://github.com/usuario/hospital-dw"
        },
        {
            id: 3,
            title: "Health Data Analytics Platform",
            image: "/project3.jpg", 
            description: "Web platform for healthcare data visualization and analysis using modern web technologies. Machine learning algorithms for predictive healthcare analytics and patient outcome prediction.",
            technologies: ["React", "Node.js", "MongoDB", "D3.js", "Scikit-learn"],
            github: "https://github.com/usuario/health-analytics"
        }
    ];

    return (
        <div className={styles.projectsPage}>
            <div className={styles.container}>
                <div className={styles.projectsHeader}>
                    <h1 className={styles.pageTitle}>Projects</h1>
                    <p className={styles.subtitle}>
                        Here are some of my recent projects in data science, machine learning, and healthcare technology.
                    </p>
                </div>

                <div className={styles.projectsGrid}>
                    {projects.map((project) => (
                        <div key={project.id} className={styles.projectCard}>
                            <div className={styles.projectImage}>
                                <img src={project.image} alt={project.title} />
                                <div className={styles.imageOverlay}>
                                    <a 
                                        href={project.github} 
                                        target="_blank" 
                                        rel="noopener noreferrer"
                                        className={styles.overlayLink}
                                    >
                                        <i className="fab fa-github"></i>
                                        View on GitHub
                                    </a>
                                </div>
                            </div>
                            <div className={styles.projectContent}>
                                <h3 className={styles.projectTitle}>{project.title}</h3>
                                <div className={styles.projectTech}>
                                    {project.technologies.map((tech, index) => (
                                        <span key={index} className={styles.techTag}>
                                            {tech}
                                        </span>
                                    ))}
                                </div>
                                <p className={styles.projectDescription}>{project.description}</p>
                            </div>
                            <div className={styles.projectFooter}>
                                <a 
                                    href={project.github} 
                                    target="_blank" 
                                    rel="noopener noreferrer"
                                    className={styles.githubIcon}
                                >
                                    <i className="fab fa-github"></i>
                                </a>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default Projects;
